import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

ReactDOM.render(
  <>
  <div className='cards'>
      <div className='card'>
        <img
        src='https://m.media-amazon.com/images/M/MV5BZTk3ZTEzNGUtZTcwYy00NmRmLWFhMGYtZjA4NWY1ZWI4MzMyXkEyXkFqcGdeQXVyMTkxNjUyNQ@@._V1_FMjpg_UX1000_.jpg'
       alt="mypic" 
       className="card_info"></img>
       <div className='card_category'>A Netflix Original  series
       <h3 className='card_tittle'>CINDERAL
         </h3>
         <a href='https://www.themoviedb.org/movie/150689-cinderella'
         target="_blank">

           <button>watch Now</button>
           </a>
           </div>
           </div>

        </div>
  </>,
  document.getElementById('root')
);

